(5, '', 'Day 1:\n\nTaj Mahal: Start your day by visiting the Taj Mahal, one of the most iconic monuments in the world. It is open from sunrise to sunset, so try to get there as early as possible to avoid the crowds and the heat. You can spend a few hours exploring the gardens and the mausoleum and learning about the history and architecture of this stunning monument.\n\nAgra Fort: After visiting the Taj Mahal, head to Agra Fort, which is located just 2.5 kilometers away. This massive fort was built by the Mughal emperor Akbar in the 16th century and served as the residence of the Mughal emperors for several generations. The fort has many impressive structures and gardens, and it\'s worth spending a few hours exploring the complex.\n\nItimad-ud-Daulah\'s Tomb: Also known as the Baby Taj, this beautiful tomb is located on the eastern bank of the Yamuna River. It was built in the 17th century by Nur Jahan, the wife of the Mughal emperor Jahangir, in memory of her father. The tomb is made of white marble and has intricate carvings and inlay work.#\n\nDay 2:\n\nFatehpur Sikri: On your second day, take a day trip to Fatehpur Sikri, which is located about 40 kilometers from Agra. This deserted city was built by the Mughal emperor Akbar in the 16th century and served as the capital of the Mughal Empire for a brief period. The city has many impressive structures, including the Buland Darwaza, the Panch Mahal, and the Diwan-i-Khas.\n\nAkbar\'s Tomb: After returning from Fatehpur Sikri, visit Akbar\'s Tomb, which is located in Sikandra, about 10 kilometers from Agra. This impressive tomb was built by Akbar himself in the late 16th century and has many beautiful carvings and decorations. The tomb is set in a large garden and is a peaceful place to relax and reflect.\n\nMehtab Bagh: Finish your day by visiting Mehtab Bagh, which is located on the opposite bank of the Yamuna River from the Taj Mahal. This garden was built by the Mughal emperor Babur in the 16th century and provides a stunning view of the Taj Mahal at sunset. You can relax in the gardens and watch the sunset over the Taj Mahal, a perfect way to end your two-day trip to Agra.', 'Agra', 'Day 1:\r\n\r\nTaj Mahal\r\nAgra Fort\r\nItimad-ud-Daulah\'s Tomb\r\nDay 2:\r\n\r\nFatehpur Sikri\r\nAkbar\'s Tomb\r\nMehtab Bagh', 2, 10000, 'Day 1:\n\nTaj Mahal: Start your trip by visiting the Taj Mahal, one of the most iconic monuments in the world. Spend a few hours exploring the gardens and the mausoleum and learning about the history and architecture of this stunning monument.\n\nAgra Fort: After visiting the Taj Mahal, head to Agra Fort, a massive fort built by the Mughal emperor Akbar in the 16th century. Spend the rest of the day exploring the fort and its many impressive structures.# \nDay 2:\n\nFatehpur Sikri: Take a day trip to Fatehpur Sikri, a deserted city located about 40 kilometers from Agra. Explore the many impressive structures, including the Buland Darwaza, the Panch Mahal, and the Diwan-i-Khas.#\nDay 3:\n\nAkbar\'s Tomb: Visit Akbar\'s Tomb, located in Sikandra, about 10 kilometers from Agra. This impressive tomb was built by Akbar himself in the late 16th century and has many beautiful carvings and decorations.\n\nMehtab Bagh: After visiting Akbar\'s Tomb, head to Mehtab Bagh, which provides a stunning view of the Taj Mahal at sunset.#\n\nDay 4:\n\nJama Masjid: Visit the Jama Masjid, a large mosque built by the Mughal emperor Shah Jahan in the 17th century. The mosque has many impressive features, including a large courtyard and a stunning marble dome.\n\nTomb of Mariam-uz-Zamani: Visit the Tomb of Mariam-uz-Zamani, the wife of Akbar and mother of Jahangir. The tomb is located in Sikandra and has many beautiful carvings and decorations.#\n\nDay 5:\n\nGuru ka Tal: Visit Guru ka Tal, a historic gurudwara located on the banks of a beautiful lake. The gurudwara is associated with the ninth Sikh guru, Guru Tegh Bahadur, and has many beautiful features, including a large prayer hall and a beautiful marble exterior.\n\nWildlife SOS: Visit Wildlife SOS, an animal rescue center that is home to many rescued elephants and other animals. The center offers guided tours and educational programs.\n\nThis itinerary includes the main highlights of Agra and the surrounding areas and allows for a more in-depth exploration of the city\'s history and culture.', 'Day 1:\r\n\r\nTaj Mahal\r\nAgra Fort\r\nDay 2:\r\n\r\nFatehpur Sikri\r\nDay 3:\r\n\r\nAkbar\'s Tomb\r\nMehtab Bagh\r\nDay 4:\r\n\r\nJama Masjid\r\nTomb of Mariam-uz-Zamani\r\nDay 5:\r\n\r\nGuru ka Tal\r\nWildlife SOS', 5, 50000),
(6, '', 'Day 1:\n\nMorning: Arrive at Mumbai\'s Chhatrapati Shivaji International Airport and meet your guide at the arrivals area.\nHead straight to visit the iconic Gateway of India monument and take a boat ride to see the Elephanta Caves.\nAfternoon: Visit the Chhatrapati Shivaji Terminus railway station and explore the historic Victorian architecture.\nLunch: Enjoy a traditional Indian lunch at a local restaurant.\nEvening: Take a stroll at Marine Drive and enjoy the sunset. Have dinner at a restaurant nearby before heading back to your hotel.#\nDay 2:\n\nMorning: Start your day by visiting the famous Siddhivinayak Temple and take blessings.\nNext, explore the bustling Crawford Market and street shopping areas in Colaba.\nAfternoon: Visit the Prince of Wales Museum and appreciate the art, history, and culture of Mumbai.\nLunch: Enjoy a delicious lunch at a local restaurant.\nEvening: Head to the Bandra-Worli Sea Link, and click some photos.\nEnd the day with dinner at one of the city\'s top restaurants, followed by a drink at a local bar.', 'Mumbai', 'Day 1:\n\nGateway of India\nElephanta Caves\nChhatrapati Shivaji Terminus railway station\nMarine Drive\nDay 2:\n\nSiddhivinayak Temple\nCrawford Market\nColaba street shopping areas\nPrince of Wales Museum\nBandra-Worli Sea Link', 2, 8000, 'Day 1:\n\nMorning: Arrive at Mumbai\'s Chhatrapati Shivaji International Airport and meet your guide at the arrivals area.\nHead straight to visit the iconic Gateway of India monument and take a boat ride to see the Elephanta Caves.\nAfternoon: Visit the Chhatrapati Shivaji Terminus railway station and explore the historic Victorian architecture.\nLunch: Enjoy a traditional Indian lunch at a local restaurant.\nEvening: Take a stroll at Marine Drive and enjoy the sunset. Have dinner at a restaurant nearby before heading back to your hotel.#\nDay 2:\n\nMorning: Start your day by visiting the famous Siddhivinayak Temple and take blessings.\nNext, explore the bustling Crawford Market and street shopping areas in Colaba.\nAfternoon: Visit the Prince of Wales Museum and appreciate the art, history, and culture of Mumbai.\nLunch: Enjoy a delicious lunch at a local restaurant.\nEvening: Head to the Bandra-Worli Sea Link, and click some photos.\nEnd the day with dinner at one of the city\'s top restaurants, followed by a drink at a local bar.#\nDay 3:\n\nMorning: Take a ferry to the picturesque Elephanta Island and explore the rock-cut cave temples.\nAfternoon: Visit the Haji Ali Dargah, a mosque and tomb located in the middle of the Arabian Sea.\nLunch: Enjoy a seafood lunch at a local restaurant.\nEvening: Visit the iconic Taj Mahal Palace Hotel and enjoy high tea at their famous Sea Lounge.#\nDay 4:\n\nMorning: Explore the Sanjay Gandhi National Park, which is home to diverse flora and fauna.\nAfternoon: Visit the Kanheri Caves, a group of rock-cut caves and monasteries.\nLunch: Enjoy a picnic lunch in the park or have lunch at a local restaurant.\nEvening: Take a walk at Juhu Beach and have dinner at one of the beachside restaurants.#\nDay 5:\n\nMorning: Visit the famous Film City, which is the hub of the Indian film industry.\nAfternoon: Explore the Bandra suburb and visit the famous Mount Mary Church.\nLunch: Enjoy a local lunch at a restaurant in Bandra.\nEvening: Go for a shopping spree at Linking Road and Hill Road and buy souvenirs for your loved ones.\nEnd the day with dinner at a local restaurant.', 'Day 1:\n\nGateway of India\nElephanta Caves\nChhatrapati Shivaji Terminus railway station\nMarine Drive\nDay 2:\n\nSiddhivinayak Temple\nCrawford Market\nColaba street shopping areas\nPrince of Wales Museum\nBandra-Worli Sea Link\nDay 3:\n\nElephanta Island\nHaji Ali Dargah\nTaj Mahal Palace Hotel\nChowpatty Beach\nDay 4:\n\nSanjay Gandhi National Park\nKanheri Caves\nJuhu Beach\nDay 5:\n\nFilm City\nMount Mary Church\nLinking Road\nHill Road\nI hope this helps you plan your trip to Mumbai!\n\n\n\n\n', 5, 25000),
(7, 0x4172726179, 'Day 1:\n\nVisit the Raghunath Temple, one of the largest Hindu temples in North India and an important pilgrimage site for Hindus.\nExplore the Bahu Fort, a historic fort located on a hilltop overlooking the Tawi River. The fort houses a temple dedicated to the Hindu goddess Kali.\nVisit the Amar Mahal Museum and Library, a beautiful palace-turned-museum that showcases Jammu\'s rich history and culture.\nIn the evening, enjoy a stroll around the famous Bagh-e-Bahu garden, which is located adjacent to the Bahu Fort.#\nDay 2:\n\nVisit the Mansar Lake, a beautiful lake surrounded by dense forests and hills, about 62 km from Jammu. You can enjoy boating, fishing, and picnicking here.\nHead to the Surinsar Lake, which is located just 24 km from Mansar Lake. Surinsar Lake is famous for its crystal-clear waters and is believed to be associated with the Hindu epic, Mahabharata.\nIn the evening, visit the Raghunath Bazaar, which is one of the oldest markets in Jammu and is known for its handicrafts, textiles, and souvenirs.', 'Jammu ', 'Day 1:\n\nRaghunath Temple\nBahu Fort\nAmar Mahal Museum and Library\nBagh-e-Bahu garden\nDay 2:\n\nMansar Lake\nSurinsar Lake\nRaghunath Bazaar', 2, 4000, 'Day 1:\n\nVisit the Raghunath Temple, one of the largest Hindu temples in North India and an important pilgrimage site for Hindus.\nExplore the Bahu Fort, a historic fort located on a hilltop overlooking the Tawi River. The fort houses a temple dedicated to the Hindu goddess Kali.\nVisit the Amar Mahal Museum and Library, a beautiful palace-turned-museum that showcases Jammu\'s rich history and culture.\nIn the evening, enjoy a stroll around the famous Bagh-e-Bahu garden, which is located adjacent to the Bahu Fort.#\nDay 2:\n\nVisit the Mansar Lake, a beautiful lake surrounded by dense forests and hills, about 62 km from Jammu. You can enjoy boating, fishing, and picnicking here.\nHead to the Surinsar Lake, which is located just 24 km from Mansar Lake. Surinsar Lake is famous for its crystal-clear waters and is believed to be associated with the Hindu epic, Mahabharata.\nReturn to Jammu in the evening.#\nDay 3:\n\nExplore the old city of Jammu and visit the Dogra Art Museum to learn about the art and culture of the Dogra dynasty, who ruled Jammu and Kashmir for many centuries.\nVisit the Mubarak Mandi Palace, a magnificent palace complex built over 150 years ago, showcasing a blend of Rajasthani, Mughal, and European architectural styles.\nIn the evening, visit the Raghunath Bazaar, which is one of the oldest markets in Jammu and is known for its handicrafts, textiles, and souvenirs.#\nDay 4:\n\nVisit the Shiv Khori Cave Temple, a Hindu pilgrimage site located in the Reasi district of Jammu, which is believed to be one of the holiest shrines of Lord Shiva.\nReturn to Jammu in the evening.#\nDay 5:\n\nVisit the Vaishno Devi Temple, one of the most revered Hindu shrines in India, located in the Trikuta Hills about 42 km from Jammu. You can reach the temple by trekking or by taking a helicopter ride.\nReturn to Jammu in the evening.', 'Day 1:\n\nRaghunath Temple\nBahu Fort\nAmar Mahal Museum and Library\nBagh-e-Bahu garden\nDay 2:\n\nMansar Lake\nSurinsar Lake\nDay 3:\n\nDogra Art Museum\nMubarak Mandi Palace\nRaghunath Bazaar\nDay 4:\n\nShiv Khori Cave Temple\nDay 5:\n\nVaishno Devi Temple', 5, 9000),
(8, '', 'Day 1:\n\nMorning: Arrival in Jaipur, the capital city of Rajasthan, and check-in at the hotel.\nAfternoon: Visit the Hawa Mahal, a unique palace known for its intricate latticework windows, followed by the City Palace, a magnificent complex of palaces, courtyards, and gardens.\nEvening: Enjoy a traditional Rajasthani dinner at Chokhi Dhani, a cultural village that offers a glimpse into the state\'s rich heritage and traditions.#\nDay 2:\n\nMorning: Visit the Amber Fort, a majestic hilltop fortress located just outside Jaipur, and enjoy a guided tour of its palaces, courtyards, and gardens.\nAfternoon: Drive to Jodhpur, known as the \"Blue City,\" and visit the impressive Mehrangarh Fort, one of the largest and most well-preserved forts in India.\nEvening: Explore the vibrant markets and bazaars of Jodhpur, known for their handicrafts, textiles, and spices, and savor the local cuisine at a traditional restaurant.', 'Rajasthan', 'Jaipur - Hawa Mahal, City Palace, and Amber Fort\nJodhpur - Mehrangarh Fort and local markets', 2, 4000, 'Day 1:\n\nMorning: Arrival in Jaipur and check-in at the hotel.\nAfternoon: Visit the Hawa Mahal, City Palace, and Jantar Mantar.\nEvening: Explore the vibrant markets and bazaars of Jaipur.#\nDay 2:\n\nMorning: Visit the Amber Fort and Jal Mahal.\nAfternoon: Drive to Ajmer and visit the Dargah Sharif of Moinuddin Chishti and the Taragarh Fort.\nEvening: Return to Jaipur and enjoy dinner at a local restaurant.#\nDay 3:\n\nMorning: Drive to Jodhpur and check-in at the hotel.\nAfternoon: Visit the Mehrangarh Fort, Jaswant Thada, and the Umaid Bhawan Palace Museum.\nEvening: Enjoy a traditional Rajasthani dinner at a local restaurant.#\nDay 4:\n\nMorning: Drive to Udaipur and check-in at the hotel.\nAfternoon: Visit the City Palace, Lake Pichola, and Jagdish Temple.\nEvening: Enjoy a boat ride on Lake Pichola and watch the sunset.#\nDay 5:\n\nMorning: Visit the Kumbhalgarh Fort and the Ranakpur Jain Temple.\nAfternoon: Drive back to Udaipur and explore the local markets.\nEvening: Departure from Udaipur.', 'Day 1:\n\nJaipur - Hawa Mahal, City Palace, and Jantar Mantar\nDay 2:\n\nJaipur - Amber Fort and Jal Mahal\nAjmer - Dargah Sharif of Moinuddin Chishti and the Taragarh Fort\nDay 3:\n\nJodhpur - Mehrangarh Fort, Jaswant Thada, and Umaid Bhawan Palace Museum\nDay 4:\n\nUdaipur - City Palace, Lake Pichola, and Jagdish Temple\nDay 5:\n\nKumbhalgarh Fort and Ranakpur Jain Temple', 5, 7000);
INSERT INTO `places` (`pid`, `image`, `description`, `title`, `tourist_attraction`, `package`, `price`, `description2`, `tourist_attraction2`, `package2`, `price2`) VALUES
(9, , 'Day 1:\n\nMorning: Arrival in Khajuraho and check-in at the hotel.\nAfternoon: Visit the famous Khajuraho temples, a UNESCO World Heritage Site known for their intricate carvings and sculptures.\nEvening: Enjoy a sound and light show at the Western Group of Temples.#\nDay 2:\n\nMorning: Drive to Panna National Park and enjoy a jungle safari to spot tigers, leopards, and other wildlife.\nAfternoon: Visit the Raneh Falls and Ken Gharial Sanctuary to spot crocodiles and other reptiles.\nEvening: Departure from Khajuraho.', 'Madhyapradesh', 'Day 1:\n\nKhajuraho - Khajuraho temples, Western Group of Temples\nDay 2:\n\nPanna National Park - Jungle safari to spot tigers, leopards, and other wildlife\nRaneh Falls and Ken Gharial Sanctuary - To spot crocodiles and other reptiles.', 2, 4000, 'Day 1:\n\nMorning: Arrival in Bhopal and check-in at the hotel.\nAfternoon: Visit the iconic Taj-ul-Masajid, the largest mosque in India, and the nearby Shaukat Mahal.\nEvening: Enjoy a boat ride on the tranquil waters of the Upper Lake.#\nDay 2:\n\nMorning: Drive to Sanchi and visit the Sanchi Stupa, a UNESCO World Heritage Site and an important Buddhist pilgrimage site.\nAfternoon: Return to Bhopal and visit the Bharat Bhavan, a renowned museum of Indian art and culture.\nEvening: Explore the local markets and taste the street food of Bhopal.#\nDay 3:\n\nMorning: Drive to Pachmarhi and check-in at the hotel.\nAfternoon: Visit the Pandav Caves and enjoy the panoramic views from Dhoopgarh, the highest point in the Satpura Range.\nEvening: Enjoy a bonfire and barbeque at the hotel.#\nDay 4:\n\nMorning: Visit the Bee Falls, Rajat Pratap Falls, and Handi Khoh, three popular waterfalls in Pachmarhi.\nAfternoon: Visit the Jatashankar Caves and the Mahadeo Hills.\nEvening: Return to the hotel and relax.#\nDay 5:\n\nMorning: Drive to Bhopal and visit the Bhojpur Temple, an ancient temple dedicated to Lord Shiva.\nAfternoon: Visit the Bhimbetka rock shelters, a UNESCO World Heritage Site and an important archaeological site.\nEvening: Departure from Bhopal.', 'Day 1:\n\nBhopal - Taj-ul-Masajid, Shaukat Mahal, Upper Lake\nDay 2:\n\nSanchi - Sanchi Stupa\nBhopal - Bharat Bhavan\nDay 3:\n\nPachmarhi - Pandav Caves, Dhoopgarh\nHotel - Bonfire and barbeque\nDay 4:\n\nPachmarhi - Bee Falls, Rajat Pratap Falls, Handi Khoh, Jatashankar Caves, Mahadeo Hills\nDay 5:\n\nBhopal - Bhojpur Temple\nBhimbetka - Bhimbetka rock shelters', 5, 7999);
