(10, 0x576861747341707020496d61676520323032322d31312d30352061742031392e32372e35382e6a7067, 'oo', 'alsndo n', 'nioqi', 1, 12, '2', '213', 123, 213),
(11, 0x53637265656e73686f7420283232292e706e67, 'Day 1, we will start our journey by visiting the iconic Red Fort in Delhi, followed by shopping and delicious street food at Chandni Chowk. In the afternoon, we will drive to Agra to visit the Taj Mahal, one of the Seven Wonders of the World, and the Agra Fort.#    \nDay 2, we will visit the stunning Amber Fort in Jaipur, followed by the Hawa Mahal, City Palace, and Jantar Mantar. We will end the day with some shopping at the vibrant bazaars of Jaipur. This itinerary can be customized based on your preferences and interests, and can include additional attractions or activities as per your choice. Our experienced guides and comfortable transportation will ensure that you have a memorable and hassle-free trip to North India. Book now to experience the rich history and cultural heritage of this vibrant region!', 'North India', 'Day 1:\n\nGateway of India\nElephanta Caves\nChhatrapati Shivaji Terminus railway station\nMarine Drive\nDay 2:\n\nSiddhivinayak Temple\nCrawford Market\nColaba street shopping areas\nPrince of Wales Museum\nBandra-Worli Sea Link', 2, 20000, 'Day 1: Arrival in Delhi\n\nArrive at Delhi airport, where you will be met by our representative.\nTransfer to your hotel and check-in.\nIn the afternoon, enjoy a sightseeing tour of Old Delhi, including a visit to the Red Fort, Jama Masjid, and Chandni Chowk.\nReturn to your hotel for dinner and overnight stay.#\nDay 2: Delhi - Agra\n\nAfter breakfast, depart for Agra, home of the Taj Mahal.\nEn route, visit the magnificent tomb of Akbar the Great in Sikandra.\nUpon arrival in Agra, check-in at your hotel and freshen up.\nIn the afternoon, visit the Taj Mahal, one of the Seven Wonders of the World, and Agra Fort.\nReturn to your hotel for dinner and overnight stay.#\nDay 3: Agra - Jaipur\n\nAfter breakfast, depart for Jaipur, the Pink City of Rajasthan.\nEn route, visit Fatehpur Sikri, the abandoned capital of the Mughal Empire.\nUpon arrival in Jaipur, check-in at your hotel and freshen up.\nIn the evening, visit the famous Chokhi Dhani Village to experience the traditional Rajasthani way of life.\nReturn to your hotel for dinner and overnight stay.#\nDay 4: Jaipur\n\nAfter breakfast, enjoy a full-day sightseeing tour of Jaipur, including a visit to Amber Fort, City Palace, Jantar Mantar, and Hawa Mahal.\nIn the evening, visit the local markets for some souvenir shopping.\nReturn to your hotel for dinner and overnight stay.#\nDay 5: Jaipur - Delhi\n\nAfter breakfast, depart for Delhi.\nUpon arrival in Delhi, enjoy a half-day sightseeing tour of New Delhi, including a visit to Qutub Minar, Humayun\'s Tomb, and India Gate.\nLater, transfer to the airport for your onward journey.', 'Day 1:\n\nRed Fort\nJama Masjid\nChandni Chowk\nDay 2:\n\nTaj Mahal\nAgra Fort\nDay 3:\n\nTomb of Akbar the Great in Sikandra\nFatehpur Sikri\nChokhi Dhani Village\nDay 4:\n\nAmber Fort\nCity Palace\nJantar Mantar\nHawa Mahal\nDay 5:\n\nQutub Minar\nHumayun\'s Tomb\nIndia Gate', 5, 60000),
(12, 0x676f61322e6a7067, 'Day 1:\n\nVisit the UNESCO World Heritage site of Old Goa and explore the beautiful churches such as Basilica of Bom Jesus, Se Cathedral, and Church of St. Francis of Assisi.\nHead to the famous Anjuna Beach, known for its beautiful sunset and nightlife.\nVisit the Anjuna Flea Market, where you can shop for souvenirs, clothes, and accessories.#\nDay 2:\n\nVisit the beautiful and serene Dudhsagar Waterfalls, located on the border of Goa and Karnataka.\nEnjoy a relaxing day at Calangute Beach, one of the largest and most popular beaches in Goa.\nIn the evening, enjoy the nightlife of Baga Beach, known for its pubs, clubs, and beachside shacks.', 'Goa', 'Day 1:\n\nOld Goa (Basilica of Bom Jesus, Se Cathedral, and Church of St. Francis of Assisi)\nAnjuna Beach\nAnjuna Flea Market\nDay 2:\n\nDudhsagar Waterfalls\nCalangute Beach\nBaga Beach', 2, 10000, 'Day 1:\n\nVisit the UNESCO World Heritage site of Old Goa and explore the beautiful churches such as Basilica of Bom Jesus, Se Cathedral, and Church of St. Francis of Assisi.\nHead to the famous Anjuna Beach, known for its beautiful sunset and nightlife.\nVisit the Anjuna Flea Market, where you can shop for souvenirs, clothes, and accessories.#\nDay 2:\n\nVisit the beautiful and serene Dudhsagar Waterfalls, located on the border of Goa and Karnataka.\nEnjoy a relaxing day at Calangute Beach, one of the largest and most popular beaches in Goa.\nIn the evening, enjoy the nightlife of Baga Beach, known for its pubs, clubs, and beachside shacks.#\nDay 3:\n\nTake a day trip to the picturesque Chapora Fort and Vagator Beach.\nVisit the famous Saturday Night Market in Arpora, which offers a wide range of products and food stalls.#\nDay 4:\n\nSpend the day at the charming Palolem Beach, located in South Goa.\nTake a boat ride to see the dolphins and explore the nearby islands.#\nDay 5:\n\nVisit the stunning Aguada Fort, which offers breathtaking views of the Arabian Sea.\nSpend the evening at the vibrant Candolim Beach, known for its water sports and nightlife.', 'Day 1:\n\nOld Goa (Basilica of Bom Jesus, Se Cathedral, and Church of St. Francis of Assisi)\nAnjuna Beach\nAnjuna Flea Market\nDay 2:\n\nDudhsagar Waterfalls\nCalangute Beach\nBaga Beach\nDay 3:\n\nChapora Fort\nVagator Beach\nSaturday Night Market in Arpora\nDay 4:\n\nPalolem Beach\nBoat ride to see dolphins and nearby islands\nDay 5:\n\nAguada Fort\nCandolim Beach', 5, 22000),
(13, 0x4b6f6c6b617461312e6a7067, 'Day 1:\n\nStart your day by visiting the Victoria Memorial, a stunning monument built in memory of Queen Victoria. You can explore the museum inside and take a stroll through the gardens surrounding the memorial.\n\nNext, head to the St. Paul\'s Cathedral, one of the oldest cathedrals in India. Admire the beautiful Gothic architecture and stained-glass windows.\n\nAfter that, visit the Kalighat Temple, one of the most important Hindu temples in Kolkata. The temple is dedicated to Goddess Kali and is known for its vibrant atmosphere and colorful decorations.\n\nIn the evening, head to Park Street, a popular hub for shopping and nightlife. You can enjoy dinner at one of the many restaurants and cafes in the area.#\n\nDay 2:\n\nStart your day by visiting the Howrah Bridge, one of the most iconic landmarks in Kolkata. You can walk across the bridge and enjoy the panoramic views of the Hooghly River.\n\nNext, visit the Indian Museum, the oldest and largest museum in India. It houses an impressive collection of art, artifacts, and natural history exhibits.\n\nAfter that, head to the Mother House, the headquarters of the Missionaries of Charity founded by Mother Teresa. You can learn about her life and work at the museum inside.\n\nIn the evening, visit the Dakshineswar Kali Temple, another important Hindu temple dedicated to Goddess Kali. The temple is known for its intricate architecture and peaceful surroundings.\n\nThat concludes our 2-day itinerary for Kolkata. Of course, there are many other places to explore in the city, so feel free to customize the itinerary based on your interests and preferences.', 'Kolkata', 'Day 1:\n\nVictoria Memorial\nSt. Paul\'s Cathedral\nKalighat Temple\nPark Street\nDay 2:\n\nHowrah Bridge\nIndian Museum\nMother House\nDakshineswar Kali Temple', 2, 15000, 'Day 1: Explore Kolkata\'s Colonial Past\n\nStart your day by visiting the Victoria Memorial, an iconic landmark of Kolkata.\nNext, head to St. Paul\'s Cathedral, a beautiful church built in the Gothic Revival style.\nTake a walk around the Maidan, a large urban park that was once used for military exercises.\nIn the evening, take a stroll down Park Street and check out some of the city\'s best restaurants and bars.#\nDay 2: Discover Kolkata\'s Culture and Cuisine\n\nStart your day by visiting the Kalighat Temple, one of the most important Hindu temples in Kolkata.\nNext, head to the Dakshineswar Kali Temple, another important temple located on the banks of the Hooghly river.\nAfter lunch, visit the Indian Museum, one of the oldest and largest museums in India.\nIn the evening, take a food tour of Kolkata and try some of the city\'s famous dishes like phuchka, kathi rolls, and rasgulla.#\nDay 3: Explore Kolkata\'s Art Scene\n\nStart your day by visiting the Tagore House, the childhood home of Nobel laureate Rabindranath Tagore.\nNext, head to the Academy of Fine Arts, a prominent cultural institution in Kolkata.\nAfter lunch, visit the Birla Academy of Art and Culture, which houses a collection of modern and contemporary art.\nIn the evening, attend a performance at the Rabindra Sadan, a cultural center that hosts plays, music concerts, and dance performances.#\nDay 4: Visit Kolkata\'s Historical Sites\n\nStart your day by visiting the Howrah Bridge, an iconic bridge that spans the Hooghly river.\nNext, head to the Fort William, a large fort built by the British in the 18th century.\nAfter lunch, visit the Marble Palace, a stunning mansion that houses a collection of art and antiques.', 'Victoria Memorial\r\nDakshineswar Kali Temple\r\nHowrah Bridge\r\nSt. Paul\'s Cathedral\r\nIndian Museum\r\nPark Street\r\nScience City\r\nMarble Palace\r\nMother House\r\nKolkata Botanical Garden', 5, 25000),
(14, 0x617373616d322e6a7067, 'Day 1:\r\n\r\nMorning - Arrival in Guwahati and transfer to hotel.\r\n\r\nAfternoon - Sightseeing tour of Guwahati including Kamakhya Temple, Umananda Temple, and a river cruise on the Brahmaputra River.\r\n\r\nEvening - Return to the hotel for dinner and overnight stay.\r\n\r\nDay 2:\r\n\r\nMorning - Depart from Guwahati to Kaziranga National Park for a wildlife safari.\r\n\r\nAfternoon - Lunch and continue with the wildlife safari in Kaziranga National Park.\r\n\r\nEvening - Return to Guwahati and transfer to the airport or railway station for departure.\r\n', 'Assam', 'Kamakhya Temple, Guwahati\r\nUmananda Temple, Guwahati\r\nRiver cruise on the Brahmaputra River, Guwahati\r\nKaziranga National Park', 2, 7500, 'Day 1:\r\n\r\nMorning - Arrival in Guwahati and transfer to hotel.\r\n\r\nAfternoon - Sightseeing tour of Guwahati including Kamakhya Temple, Umananda Temple, and a river cruise on the Brahmaputra River.\r\n\r\nEvening - Return to the hotel for dinner and overnight stay.\r\n\r\nDay 2:\r\n\r\nMorning - Depart from Guwahati to Manas National Park for a wildlife safari.\r\n\r\nAfternoon - Lunch and continue with the wildlife safari in Manas National Park.\r\n\r\nEvening - Return to the hotel for dinner and overnight stay.\r\n\r\nDay 3:\r\n\r\nMorning - Drive to Shillong and en-route visit Umiam Lake.\r\n\r\nAfternoon - Explore the local markets in Shillong and visit Ward\'s Lake.\r\n\r\nEvening - Return to the hotel for dinner and overnight stay.\r\n\r\nDay 4:\r\n\r\nMorning - Visit the Living Root Bridges of Meghalaya.\r\n\r\nAfternoon - Explore the Mawphlang Sacred Forest and trek to the David Scott Trail.\r\n\r\nEvening - Return to the hotel for dinner and overnight stay.\r\n\r\nDay 5:\r\n\r\nMorning - Visit the Mawlynnong Village, known as the cleanest village in Asia.\r\n\r\nAfternoon - Drive to Guwahati for departure.\r\n\r\n', 'Day 1:\r\n\r\nKamakhya Temple, Guwahati\r\nUmananda Temple, Guwahati\r\nRiver cruise on the Brahmaputra River, Guwahati\r\nDay 2:\r\n\r\nManas National Park\r\nDay 3:\r\n\r\nUmiam Lake\r\nWard\'s Lake, Shillong\r\nDay 4:\r\n\r\nLiving Root Bridges of Meghalaya\r\nMawphlang Sacred Forest\r\nDavid Scott Trail\r\nDay 5:\r\n\r\nMawlynnong Village, Meghalaya', 5, 14599);

